import React,{Component} from 'react';

class MainPage extends Component{

  render(){
    return(

      <div class="row">
        <div class="col s12">This div is 12-columns wide on all screen sizes</div>
        <div class="col s6">6-columns (one-half)</div>
        <div class="col s6">6-columns (one-half)</div>
      </div>
    )
  }
}

export default MainPage;
